import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to be present
    await page.waitForSelector('#productsGrid .product-card', { timeout: 5000 });

    // Click the first product card to open the Product Detail Modal
    const firstProductCard = await page.$('#productsGrid .product-card');
    if (!firstProductCard) throw new Error('No product card found in featured products');
    await firstProductCard.click();

    // Wait for the modal to appear (by id or class)
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Wait for modal to be visible (display: block)
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    }, { timeout: 5000 });

    // Take screenshot of the opened Product Detail Modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal_open.png'));

    // Extract product title from the modal
    const productTitle = await page.$eval('#productDetail .product-detail-title', el => el.textContent.trim());

    // Verify modal is open by checking for the close button
    const closeBtnVisible = await page.$eval('#productModal .close', el => !!el);

    return {
      success: true,
      action: "Opened the Product Detail Modal by clicking a product card and verified its content.",
      extractedData: {
        productTitle,
        closeBtnVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
